import PostItem from '../PostItem/PostItem';
import '../Posts.css';

const PostContainer = () => {
    return (
        <>
            <div class='container-p15 mt-3'>
            <ul class='content-cotainer-list'>
                <PostItem/>
            </ul>
        </div>
        </>
    )
}
export default PostContainer;
